            FUNCTIONALITY
* Orders will show up in a data table for the jewelers to take action on* Orders submitted to the jeweler either through the jewelers personal page or created by the jeweler show here* Row color will indicate the status of the order (submitted to premier, processing, shipped, etc...)* The action column will give jewelers the ability to edit, submit or delete an order* Columns should be sortable by the header column* Search box in the card header to search anything in the orders and a date box to search by dateQUESTIONS
